issue.body:
A seed value of 0 is treated as false so both instances of lcg.setSeed fall through to the Math.round(Math.random() * m) case. As a result, you get a different randomly-selected seed each time instead of the seed you asked for.

Here's an alternative implementation that permits a seed of 0 and ensures that the seed is an integer between 0 and m-1:
```javascript
setSeed: function (val) {
  z = seed = Math.floor((val === undefined) ? Math.random() * m : val);
}
```

